import "./HeroimageStyles.css";

import React from 'react'

import IntroImg from "../assets/2.webp"

const Heroimage = () => {
  return <div className="hero">
      <div className="mask">
        <img className="into-img" src={IntroImg} alt="IntroImg" />
      </div>
    </div>;
  
}

export default Heroimage;
